import React from 'react';

function AdminLogin() {
  return (
    <div className="bg-gray-100 flex justify-center items-center h-screen">
      <div className="bg-white p-8 rounded-lg shadow-md w-80">
        <h2 className="text-2xl mb-4 text-center">Login</h2>
        <form>
          <div className="mb-4">
            <label htmlFor="username" className="block mb-2">Username</label>
            <input type="text" id="username" name="username" placeholder="Enter your username" className="w-full px-3 py-2 border rounded-lg" />
          </div>
          <div className="mb-4">
            <label htmlFor="password" className="block mb-2">Password</label>
            <input type="password" id="password" name="password" placeholder="Enter your password" className="w-full px-3 py-2 border rounded-lg" />
          </div>
          <button type="submit" className="w-full bg-blue-500 text-white font-semibold py-2 px-4 rounded-lg hover:bg-blue-600">Login</button>
        </form>
      </div>
    </div>
  );
}

export default AdminLogin;
